import classes from "./MealsSummary.module.css";

const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Delious and Healthy Meal, at Your Doorstep</h2>
      <p>
        Order your favourite and delious food from the comfort of your home now
        at discounted price!{" "}
      </p>
      <p>
        The world class chef with vast experience of cooking indian foods,
        hygenic kitchen and on time delivery!
      </p>
    </section>
  );
};

export default MealsSummary;
